import { Paper, Typography, Box } from '@material-ui/core'

const Card = ({ title, children, ...props }) => {
    return (
        <Paper>
            <Box {...props}>

                { title != undefined && 
                <Typography variant="h3">
                    {title}
                </Typography> }

                {children}

            </Box>
        </Paper>
    )
}

export default Card
